plugMedAge <- function(x, NameMedAge) {
    for (i in 1:nrow(x)) {
        if (is.na(x$Age[i])) {
            x$Age[i] <- as.numeric(NameMedAge[which(NameMedAge$Title == x$Title[i]), 2])
