plugTitleType <- function(x) {
    if (x %in% c("Capt.", "Col.", "Major.")) {
        return("officer")
    }
    else if (x %in% c("Countess.", "Don.", "Dona.", "Jonkheer.", "Lady.", "Mlle.", "Mme.", "Sir.")) {
        return("Royalty")
    }
    else if (x %in% c("Dr.")) {
        return("Professional")
    }
    else if (x %in% c("Master.")) {
        return("boy")
    }
    else if (x %in% c("Rev.")) {
        return("Priest")
    }
    else if (x %in% c("Miss.")) {
        return("Comm_YoungWomen")
    }
    else {
        return("Commoner")
    }
}
